CREATE TABLE itens_compra (
    id_compra INT,
    id_produto INT,
    quantidade INT,
    PRIMARY KEY (id_compra, id_produto),
    FOREIGN KEY (id_compra) REFERENCES compras(id),
    FOREIGN KEY (id_produto) REFERENCES produtos(id)
);

